import React from 'react';

function User({ user }){


    <b {...user.username}> <span>({user.email})</span></b>
}

function UserList(){
    const users = [
        {
            id: 1,
            username: 'j0dev',
            email: 'asdf@asdf.com'

        },
        {
            id: 2,
            username: 'intadd',
            email: 'qwer@asdf.com'

        },
        {
            id: 3,
            username: 'test',
            email: 'zxcv@asdf.com'

        }

    ];
    return (
        <div>
            <User user={users[0]}/>
        </div>
    ) 
}



export default UserList;
